          <img
            scr="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTObsbvRGTJUXbhzLkABpz25DUm9L37LV05xAsUpeT8hI4I49Lj"
            alt="test"
          />
        </div>
      </div>
    </div>
  );
};

export default FoodTruckList;
